import React from 'react'
import '../App.css'

function Shelter(props) {
  return (
    <div className='res'>
        <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fmyloview.com%2Fsticker-creative-simple-vector-design-animal-logo-no-FBFF87E&psig=AOvVaw0U4JAfoXr1WvUdKZxzSneF&ust=1652647187183000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCLDOh9bs3_cCFQAAAAAdAAAAABAD'></img>
        {props.name}
    </div>
  )
}

export default Shelter
